detaileddescription.para:
Override this method in a subclass of Transporter to implement the Transporters specific behaviour. It will at least contain something to let this Transporter wait in a TransportJunction for goods to carry around, like 
  TransportJunctionXY.cooperate(transportation);
 This method starts after a Transporter has been created and activated by the scheduler. It describes the behavior of this special Transporter when he is acting alone. All action taking place when this Transporter (as a master) acts together with other SimProcess es (as slaves) in some process cooperation is described in that special cooperation method of the class Transportation.
